import React from 'react';
import { useNavigate } from 'react-router-dom';
export default function ChallengeSelect(){
  const nav = useNavigate();
  return (
    <div className="card" style={{marginTop:20}}>
      <h3>Choose Learning Challenge</h3>
      <div style={{display:'flex',gap:10,marginTop:10}}>
        <button className="btn" onClick={()=>nav('/dyslexia')}>Dyslexia</button>
        <button className="btn" style={{background:'#1e90ff'}} onClick={()=>alert('ADHD flow placeholder')}>ADHD</button>
        <button className="btn" style={{background:'#4da6ff'}} onClick={()=>alert('Autism flow placeholder')}>Autism</button>
      </div>
    </div>
  );
}
